import data from "../../dummyData";
const initialState = {
  data,
  isOpen: false
};

export default function instagramReducer(state = initialState, action) {
  switch (action.type) {
    case "TOGGLE_LIKES":
      console.log();
      return {
        ...state
      };
    default:
      return state;
  }
  return state;
}
